import React from 'react'

function home() {
  return (
    <div>
        <h3>Welcome to the Home Page!</h3>
        <p>This is a simple React application with a Home page.</p>
        <button type="submit" className="btn btn-primary">Logout</button>
    </div>
  )
}

export default home
